import React from 'react'
import landing from './landing.css'
import bgPicture from '../../Picture/Streaming-Movie.jpg'

function Landing() {
    return (
        <div className='BgPicture'>
            <img style={{width:'auto', height:'600px'}} src={bgPicture} alt='backGroundPicture'/>
        </div>
    )
}

export default Landing
